import React, { Component } from 'react';
import background from './images/moviesBG.png'




class Home extends Component {
    render() {
        return (
            <div className='text-center'>
            <img src={background} alt="" />
            <p> Online Ticket Booking System</p>
            </div>
        );
    }
}

export default Home;
